def constructBST(nums):

    def constructHelper(nums, left, right):
        if left >= right:
            return None
        mid = (left + right) // 2
        root = TreeNode(nums[mid])
        root.left = constructHelper(nums, left, mid - 1)
        root.right = constructHelper(nums, mid + 1, right)
        return root
